  input: TEXT,SB23,SB23.7231,"This memo is in response to the FEC's recent correspondence
    pertaining to a potential excess contribution to Sen Robert Torricelli's campaign.  We
    have contacted the candidate's campaign committee.  Both the committee and NORPAC
    are investigating this matter.  Specifically, the $1000 in May of 1997 is being
    researched  to see if that was intended to be applied to debt retirement for the
    1996 election.  If that is the case, the 2002 contribution will not have exceeded
    the maximum allowed.   We will submit further notification when we have received
    adequate information to know if a refund of $900 is required."
